import { createApp } from 'vue'
import App from './App.vue'

//import router
import router from './router'

//import CSS
import './assets/CSS/app.css'


const app = createApp(App)

const cors = require('cors')

app.use(router)
app.use(cors({ origin: 'http://localhost:8983' }))
app.mount('#app')
